import "../assets/sass/components/main-section/main-section.scss";

import React from "react";

function Mainsection() {
  return (
    <div className="main-section-container">
      <section className="contents-header-section">
        <span id="contents-header-id1">Write something nice to me :D</span>
      </section>
      <section className="contents-main-section">
        <article className="content-textbox-list">
          <div id="text-box"></div>
        </article>
      </section>
      <div className="main-section-background">
        <div id="background-item1"></div>
        <div id="background-item2"></div>
      </div>
    </div>
  );
}

export default Mainsection;
